func tombstones2Emoji(text []uint16, isDeleted []bool) []string {
	var s = make([]string, len(text))
	for i, isDel := range isDeleted {
		if isDel == false {
			s[i] = ""
			continue
		}
		s[i] = "x"
	}
	return s
}

